import React from "react";

const KeywordComponent = ({ data }) => {
  return (
    <div className="flex flex-col items-start gap-3">
      <span className="font-serif text-xl italic">Keywords</span>
      {data?.map((item, index) => {
        return (
          <ul key={index} className="flex items-center pr-5">
            <li className="border rounded-xl p-1 text-sm hover:bg-gray-400">
              {item.name}
            </li>
          </ul>
        );
      })}
    </div>
  );
};

export default KeywordComponent;
